import React from "react";
import ReactDOM  from "react-dom";
import "./index.css";
const csstyle = {}
var time = new Date().getHours()
var greet = ''
if(time > 7 && time < 11){
  greet = "Good Morning";
  csstyle.color = "green";
}else if (time =>11 && time < 19) {
  greet = "Good Afternoon";
  csstyle.color = "orange";
} else {
  greet = "Good night";
  csstyle.color = "black";
};

ReactDOM.render(
  <>
    <h1 csstyle>Hello Sir {greet}</h1>
  </>,
  document.getElementById("root")
)
